fn main() {
    let input = "";
    let mut after = String::from(input);

    loop {
        let mut chars: Vec<char> = after.chars().collect();
        let mut newChars: Vec<char> = Vec::new();
        for (i, c) in chars.iter().enumerate() {
            let prevResult = newChars.pop();
            let mut prev = ' ';
            match prevResult {
                Some(val) => { prev = val; },
                None => {},
            }
            if c.is_uppercase() {
                if c.to_lowercase().to_string() == prev.to_string() {
                    prev = ' ';
                } else {
                    if prev.to_string() != " " {
                        newChars.push(prev);
                    }
                    newChars.push(*c);
                }
            } else if c.is_lowercase() {
                if c.to_uppercase().to_string() == prev.to_string() {
                    prev = ' ';
                } else {
                    if prev.to_string() != " " {
                        newChars.push(prev);
                    }
                    newChars.push(*c);
                }
            }
        }
        
        let newAfter = newChars.into_iter().collect();
        if newAfter == after {
            break;
        }
        after = newAfter;
    }
    println!("{}", after.len());
}
